import React from "react";
import { Container, CardDeck, Row, Card } from "react-bootstrap";
import styled from "styled-components";
import kfc_img from "../assets/img/food/kfc.jpg";
import pizza from "../assets/img/food/pizza.jpg";
import thai from "../assets/img/food/thai.jpg";

const Styles = styled.div`
  @media only screen and (max-width: 768px) {
    .navbar {
      background-color: rgba(0, 0, 0, 0.8) !important;
    }
  }

  .navbar {
    transition: 0.5s;
  }

  .nav-text {
    color: white !important;
    font-weight: 700;

    &:hover {
      color: ;
    }
  }
`;

class Restaurants extends React.Component {
  render() {
    return (
      <Styles>
        <Container>
          <CardDeck>
            <Card style={{ minWidth: "5rem" }}>
              <Card.Img variant="top" src={kfc_img} />
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This is a wider card with supporting text below as a natural
                  lead-in to additional content. This content is a little bit
                  longer.
                </Card.Text>
              </Card.Body>
            </Card>
            <Card>
              <Card.Img variant="top" src={pizza} />
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This card has supporting text below as a natural lead-in to
                  additional content.{" "}
                </Card.Text>
              </Card.Body>
            </Card>
            <Card>
              <Card.Img variant="top" src={thai} />
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This is a wider card with supporting text below as a natural
                  lead-in to additional content. This card has even longer
                  content than the first to show that equal height action.
                </Card.Text>
              </Card.Body>
            </Card>
          </CardDeck>
        </Container>
      </Styles>
    );
  }
}

export default Restaurants;
